/* eslint-disable @typescript-eslint/no-unsafe-assignment */
/* eslint-disable @typescript-eslint/restrict-template-expressions */
/* eslint-disable @typescript-eslint/no-unsafe-return */
/* eslint-disable @typescript-eslint/no-unsafe-member-access */
/* eslint-disable @typescript-eslint/no-unsafe-call */
import {
  Box,
  Button,
  Dialog,
  DialogContent,
  Grid,
  Icon,
  LinearProgress,
  makeStyles,
  MenuItem,
  Select,
  Typography,
  CircularProgress,
  Paper,
} from '@material-ui/core';
import jwtDecode from 'jwt-decode';
import React, { useEffect, useState } from 'react';
import ReactGA from 'react-ga';
import { COLORS } from '../../../plTheme';
import { _t_ } from '../../../utils/translation/translation';
import CustomizedTabs from '../../molecules/CustomisedTabs';
import Sidebar from '../Sidebar';
import Tick from '../../../assets/AdminPortal/Tick.png';

import CRM from '../../../assets/AdminPortal/CRM.jpg';
import SalesEngagement from '../../../assets/AdminPortal/SalesEngagement.jpg';
import SalesEnablement from '../../../assets/AdminPortal/SalesEnablement.jpg';
import SalesAnalytics from '../../../assets/AdminPortal/SalesAnalytics.jpg';
import HRIS from '../../../assets/AdminPortal/HRIS.jpg';
import LearningManagement from '../../../assets/AdminPortal/LearningManagement.jpg';
import ProductiveSuite from '../../../assets/AdminPortal/ProductiveSuite.jpg';
import OKR from '../../../assets/AdminPortal/OKR.jpg';
import Others from '../../../assets/AdminPortal/Others.jpg';
import { DesktopDatePicker, LocalizationProvider } from '@mui/x-date-pickers';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import TextField from '@mui/material/TextField';
import '../AdminDashboard/styles.css';
import dayjs, { Dayjs } from 'dayjs';
import ArrowBackButton from '@material-ui/icons/ArrowBack';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import EditIcon from '@material-ui/icons/Edit';
import { ButtonGroup } from 'semantic-ui-react';

ReactGA.pageview(window.location.pathname);

const useStyles = makeStyles(() => ({
  contentAlignment: {
    padding: '2%',
    backgroundColor: COLORS.HOMEPAGE_BACKGROUND,
    width: 'calc(100% + 57px)',
  },
  buttonStyles: {
    marginRight: '16px',
    width: '68.08px',
  },
  hideWhenPrint: {},
  [`@media print`]: {
    contentAlignment: {
      padding: 0,
    },
    hideWhenPrint: {
      display: 'none',
    },
    tabAlignment: {
      paddingLeft: '0%',
    },
  },
  tabAlignment: {
    paddingLeft: '1%',
  },
  titleDesc: {
    fontWeight: 300,
  },
  dialog: {
    position: 'absolute',
    width: 975,
    height: 470,
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    background: '#FFFFFF',
    border: '1px solid #D7DFE9',
    boxShadow: '0px 4px 20px rgba(126, 133, 142, 0.12)',
    borderRadius: 4,
  },
  dialog1: {
    position: 'absolute',
    width: 975,
    height: 362,
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    background: '#FFFFFF',
    border: '1px solid #D7DFE9',
    boxShadow: '0px 4px 20px rgba(126, 133, 142, 0.12)',
    borderRadius: 4,
  },
  mainTitle: {
    ' font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': '500',
    'font-size': '24px',
    'line-height': '32px',
    flex: 'auto',
    textAlign: 'center',
  },
  subTitle: {
    // width: '509px',
    height: '21px',
    'font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': '300',
    'font-size': '14px',
    'line-height': '21px',
    'text-align': 'center',
    color: '#171F46',
    flex: 'none',
    order: 1,
    'align-self': 'stretch',
    'flex-grow': '0',
  },
  root1: {
    '& .MuiLinearProgress-colorPrimary': {
      'background-color': 'rgb(182, 188, 226)',
    },
    '& .MuiLinearProgress-barColorPrimary': {
      backgroundColor: '#0B69FF',
    },
  },
  page1: {
    // width: '975px',
    // height: '383px',
    // display: 'flex',
    // 'flex-direction': 'column',
    // 'align-items': 'center',
    // padding: '0px',
    // flex: 'none',
    // 'box-sizing': 'border-box',
    // margin: '10mm auto',
    // boxSizing: 'border-box',
    // border: '1px #D3D3D3 solid',
    // borderRadius: '5px',
    // background: 'white',
    // boxShadow: '0 0 5px rgba(0, 0, 0, 0.1)',
    // pageBreakAfter: 'always',
  },
  label: {
    'font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': 500,
    'font-size': 16,
  },
  select: {
    width: '95%',
    height: 40,
    background: '#FFFFFF',
    border: '1px solid #D7DFE9',
    boxShadow: '0px 4px 20px rgba(126, 133, 142, 0.12)',
    marginTop: 10,
    borderRadius: 4,
    padding: 7,
    fontFamily: 'Roboto',
    fontStyle: 'normal',
    fontWeight: 500,
    fontSize: 14,
  },
  selectValue: {
    fontFamily: 'Roboto',
    fontStyle: 'normal',
    fontWeight: 500,
    fontSize: 14,
  },
  continueButton: {
    width: 157,
    height: 48,
    background: '#0B69FF',
    textTransform: 'none',
    'font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': 400,
    'font-size': '18px',
    'line-height': '24px',
  },
  mainTitle1: {
    ' font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': '500',
    'font-size': '24px',
    'line-height': '32px',
    flex: 'auto',
    textAlign: 'center',
    marginTop: '15%',

  }
}));

export const dates = [
  {
    startDate: '2020-01-01T00:00:00.000Z',
    endDate: '2020-12-31T23:59:59.999Z',
  },
  {
    startDate: '2020-01-01T00:00:00.000Z',
    endDate: '2020-03-31T23:59:59.999Z',
  },
  {
    startDate: '2020-04-01T00:00:00.000Z',
    endDate: '2020-06-30T23:59:59.999Z',
  },
  {
    startDate: '2020-07-01T00:00:00.000Z',
    endDate: '2020-09-30T23:59:59.999Z',
  },
  {
    startDate: '2020-10-01T00:00:00.000Z',
    endDate: '2020-12-31T23:59:59.999Z',
  },
  {
    startDate: '2020-01-01T00:00:00.000Z',
    endDate: '2020-06-30T23:59:59.999Z',
  },
  {
    startDate: '2020-07-01T00:00:00.000Z',
    endDate: '2020-12-31T23:59:59.999Z',
  },
];

const tabNames = ['DATA', 'USERS'];

const AdminDashboard: React.FC = () => {
  ReactGA.event({
    category: 'Admin Lens',
    action: 'Admin Lens',
  });
  const classes = useStyles();
  const token = localStorage.getItem('accessToken');
  const decodedToken: any = token && jwtDecode(token);
  const firstName = decodedToken.user.firstName;
  ReactGA.event({
    category: 'Admin Login',
    action: `Admin Login - ${firstName}`,
  });

  const [open, setOpen] = useState(false);
  const [openUser, setOpenUser] = useState(false)
  const [openUserList, setOpenUserList] = useState(false)
  const [openEditUser, setOpenEditUser] = useState(false)
  const [saving, setSaving] = useState(false);
  const [userSaving, setUserSaving] = useState(false)
  const [userListSaving, setUserListSaving] = useState(false)
  const [progressValue, setProgressValue] = useState(50);
  const [startDate, setStartDate] = React.useState<Dayjs | null>(null);
  const [endDate, setEndDate] = React.useState<Dayjs | null>(null);
  const [selectValue, setSelectValue] = useState('');
  const [reportName, setReportName] = useState('');
  const [title, setTitle] = useState('');
  const [system, setSystem] = useState('');
  const [file, setFile] = useState<any>('');
  const [userFile, setUserFile] = useState<any>('')
  const [userName, setUserName] = useState('');
  const [email, setEmail] = useState('');
  const [user, setUser] = useState<any>('');
  const [role, setRole] = useState<any>('');
  const [permission, setPermission] = useState<any>('');
  const [crmUploaded, setCRMUploaded] = useState<boolean>(false);
  const [SETUploaded, setSETUploaded] = useState<boolean>(false);
  const [SEMUploaded, setSEMUploaded] = useState<boolean>(false);
  const [SATUploaded, setSATUploaded] = useState<boolean>(false);
  const [HRISUploaded, setHRISUploaded] = useState<boolean>(false);
  const [LMSUploaded, setLMSUploaded] = useState<boolean>(false);
  const [PSUploaded, setPSUploaded] = useState<boolean>(false);
  const [OKRUploaded, setOKRUploaded] = useState<boolean>(false);
  const [otherUploaded, setOtherUploaded] = useState<boolean>(false);
  const [uploadedSystems, setUploadedSystems] = useState<[]>([]);
  const [activeTab, setActiveTab] = React.useState(0);

  function handleFileChange(event: any) {
    setFile(event.target.files[0]);
  }

  function handleUserFileChange(event: any) {
    setUserFile(event.target.files[0])
  }

  function imageClick(title: string, system: string): void {
    setProgressValue(50);
    setSelectValue('');
    setReportName('');
    setTitle(title);
    setSystem(system);
    setStartDate(null);
    setEndDate(null);
    setOpen(true);
    setSaving(false);
  }

  function usersListButtonClick(): void {
    setOpenUserList(true);
    setUserListSaving(false);
  }

  function usersButtonClick(): void {
    setOpenUser(true);
    setUserSaving(false)
  }

  function editButtonClick(): void {
    setOpenEditUser(true)
  }

  const handleClose = () => {
    setOpen(false);
  };

  const handleUserListClose = () => {
    setOpenUserList(false)
  }

  const handleUserClose = () => {
    setOpenUser(false)
  }

  const handleEditClose = () => {
    setOpenEditUser(false)
  }

  function handleContinueClick() {
    setProgressValue(100);
  }

  const handleBackClick = (value: number) => {
    setProgressValue && setProgressValue(value);
  };

  const handleChangeStartDate = (newValue: Dayjs | null) => {
    setStartDate(newValue);
  };

  const handleChangeEndDate = (newValue: Dayjs | null) => {
    setEndDate(newValue);
  };

  const handleChangeSelect = (e: any) => {
    console.log(e.target.value);
    setSelectValue(e.target.value);
  };

  const handleReportNameChange = (e: any) => {
    setReportName(e.target.value);
  };

  const handleUserNameChange = (e:any) => {
    console.log(e.target.value);
    setUserName(e.target.value)

  }

  const handleEmailChange = (e:any) => {
    console.log()
  }

  const handleUserChange = (e: any) => {
    setUser(e.target.value)
  }

  const handleRoleChange = (e: any) => {
    setRole(e.target.value)
  }

  const handlePermissionChange = (e: any) => {
    setPermission(e.target.value)
  }

  async function getUploadedSystems() {
    const fetchResponse = await fetch(
      `${process.env.REACT_APP_API_BASE || ''}/api/getUploadedSystems`,
      {
        method: 'GET',
      },
    );
    const jsonData = await fetchResponse.json();
    if (jsonData.length > 0) {
      setUploadedSystems && setUploadedSystems(jsonData);
      jsonData.forEach((sys: any) => {
        switch (sys.system) {
          case 'CRM':
            setCRMUploaded(true);
            break;
          case 'Sales Engagement Technology':
            setSETUploaded(true);
            break;
          case 'Sales Enablement Technology':
            setSEMUploaded(true);
            break;
          case 'Sales Analytics Technology':
            setSATUploaded(true);
            break;
          case 'HRIS system':
            setHRISUploaded(true);
            break;
          case 'Learning Management System':
            setLMSUploaded(true);
            break;
          case 'Productivity Suite (Calendar Info)':
            setPSUploaded(true);
            break;
          case 'OKR':
            setOKRUploaded(true);
            break;
          case 'Other systems':
            setOtherUploaded(true);
            break;
        }
      });
    }
  }

  useEffect(() => {
    void getUploadedSystems();
  }, []);

  async function handleSaveClick() {
    setSaving(true);
    const _startDate = dayjs(startDate).toISOString();
    const _endDate = dayjs(endDate).toISOString();
    const formData = new FormData();
    formData.append('file', file);
    formData.append('fileName', file.name);
    formData.append('system', system);
    formData.append('sub_system', selectValue);
    formData.append('reportName', reportName);
    formData.append('startDate', _startDate);
    formData.append('endDate', _endDate);

    await fetch(`${process.env.REACT_APP_API_BASE || ''}/api/uploadFile`, {
      method: 'POST',
      body: formData,
    }).then((res) => {
      console.log(res.status);
      if (res.status == 200) {
        setSaving(false);
        setOpen(false);
        switch (system) {
          case 'CRM':
            setCRMUploaded(true);
            break;
          case 'Sales Engagement Technology':
            setSETUploaded(true);
            break;
          case 'Sales Enablement Technology':
            setSEMUploaded(true);
            break;
          case 'Sales Analytics Technology':
            setSATUploaded(true);
            break;
          case 'HRIS system':
            setHRISUploaded(true);
            break;
          case 'Learning Management System':
            setLMSUploaded(true);
            break;
          case 'Productivity Suite (Calendar Info)':
            setPSUploaded(true);
            break;
          case 'OKR':
            setOKRUploaded(true);
            break;
          case 'Other systems':
            setOtherUploaded(true);
            break;
        }
      }
    });
  }

  async function handleUserSaveClick() {
    setUserSaving(true)
    await fetch(`${process.env.REACT_APP_API_BASE || ''}/api/insertAdminUsers`, {
      method: 'POST',
      body: JSON.stringify({
        userName:userName,
        email: email
      }),
    }).then((res) => {
      console.log("res" , res)
      if (res.status == 200) {
        setUserSaving(false);
        setOpenUser(false);
      }
    })
  }

  async function handleUserListSaveClick() {
    setUserListSaving(true)
    const formData = new FormData()
    formData.append('file', userFile);
    formData.append('fileName', userFile.name)
    await fetch(`${process.env.REACT_APP_API_BASE || ''}/api/insertAdminUsersList`, {
      method: 'POST',
      body: formData,
    }).then((res) => {
      console.log(res.status)
      if (res.status == 200) {
        setUserListSaving(false);
        setOpenUserList(false);
      }
    })
  }

  const handleTabChange = (num: number) => {
    setActiveTab(num);
  }

  const tableData = [
    {
      "user": "Adam",
      "role": "Sales Op",
      "permissions": "Reps Lens",

    },
    {
      "user": "Bob",
      "role": "Sales Op",
